import React, { Component } from 'react';
import "bulma/css/bulma.css";
import '../MainPage.css';
import { Route } from "react-router";
import imageOne from '../Images/phone.png'
import imageTwo from '../Images/email.png'
import Carousel, { Dots } from '@brainhubeu/react-carousel';

class About extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div class="card" style={{borderRadius:"2px"}}>

      <Carousel
        centered
        infinite
        arrows
        slidesPerPage={2}
        >
        <img src={imageOne} />
        <img src={imageTwo} />
      </Carousel>

      </div>
    );
  }
}

export default About;
